import React from 'react'

const Frontend = () => {
  return (
    <div className='skills__data'>
        <i className='bx bxl-html5 skills__icon'></i>
        <div>
            <h3 className='skills__name'>HTML</h3>
            <span className='skills__level'>Basic</span>
        </div>
    </div>
  )
}

export default Frontend
